import MenuItem from "@mui/material/MenuItem";
import MenuList from "@mui/material/MenuList";
import React from "react";
import "../styles/Header.css";
const Routes = [
  {
    name: "Home",
    path: "/",
  },
  {
    name: "Login",
    path: "/",
  },
  {
    name: "Sign up",
    path: "/",
  },
  {
    name: "Profile",
    path: "/",
  },
];
export const Header = () => {
  return (
    <>
      <MenuList open={true} variant="menu">
        {Routes.map((route) => {
          return (
            <MenuItem classes="mui-orientation" divider={true}>
              {route.name}
            </MenuItem>
          );
        })}
      </MenuList>
    </>
  );
};
